    <>
      <h3>{name}</h3>
      <p>{value}</p>
      <p> {provider}</p>
      <p> {code}</p>
      <p> {category}</p>
      <Button onClick={() => removeProduct(id)}>Remover </Button>{" "}
      <EditProduct />
    </>
  );
}
